// src/components/ShopsPage.js
import React from "react";

const ShopsPage = () => {
    return (
      <div>
        <h2>Сторінка магазинів</h2>
        <ul>
          <li>Mac</li>
          <li>CFC</li>
          <li>Noa</li>
        </ul>
      </div>
    );
};

export default ShopsPage;
